+    width: 100%;
+    background: #bdc3c7;
+    border: none;
+    height: 30px;
+    margin-bottom: 15px;
+    border-radius: 5px;
+    text-align: center;
+    font-size: 14px;
+    color: #7f8c8d;
+}
+
+input:focus {
+    outline: none;
+}
+
+button {
+    width: 100%;
+    height: 30px;
+    border: none;
+    background: #3498db;
+    color: #ecf0f1;
+    font-weight: 100;
+    margin-bottom: 15px;
+    border-radius: 5px;
+    transition: all ease-in-out .2s;
+    border-bottom: 3px solid #2980b9;
+}
+
+button:focus {
+    outline: none;
+}
+
+button:hover {
+    background: #2980b9;
+}
+
+h2 {
+    font-size: .75em;
+}
+
+a {
+    color: #e74c3c;
+    text-decoration: none;
+    transition: all ease-in-out .2s;
+}
+
+a:hover {
+    color: #c0392b;
+}
